Le maire (forme féminine : la mairesse ou la maire au Québec, au Nouveau-Brunswick et en Suisse romande, le maire ou la maire en France) est une personne physique représentant l'autorité municipale. Ce titre est utilisé en France, dans les provinces et territoires francophones ou bilingues du Canada, dans deux cantons de la Suisse romande (Genève et Jura), dans différents territoires autrefois sous domination française ainsi qu'en République démocratique du Congo (pour les villes). Le titre correspondant est : 
*  bourgmestre en Belgique et au Luxembourg, et dans les communes (subdivisions d'une ville) de la République démocratique du Congo ; 
*  syndic (syndique au féminin) dans deux cantons suisses (Fribourg et Vaud) et en Vallée d'Aoste ; 
*  président du conseil communal dans le canton de Neuchâtel ainsi qu'au Maroc ; 
*  président du conseil municipal dans le canton du Valais. L'élection du maire ou sa désignation, son rôle et ses attributions sont variables selon les villes ou les pays concernés. Il peut être le détenteur du pouvoir exécutif au niveau d'une ville ou d'un village, comme en France, au Québec et au Nouveau-Brunswick. Dans un gouvernement à gérance municipale, comme dans certaines villes du Canada et des États-Unis, le maire n'a qu'un rôle protocolaire, le conseil étant le détenteur du pouvoir exécutif.
